import Nav from 'react-bootstrap/Nav';

export default function NavBar(){
    return (
        <Nav>
            <Nav.Item>
                <Nav.Link onClick={()=>Auth.login()}href="/db">Database</Nav.Link>
            </Nav.Item>
        </Nav>
    )
}
